import React from 'react';
import {Container, MainHeading } from '../../globalStyles';
import { HeroVideo, HeroSection, HeroText,} from './HeroStyles';

const Hero = () => {
	return (
		<HeroSection>
			<HeroVideo src="./assets/bg.mp4" autoPlay muted />
			<Container>
				<MainHeading>KOSHY & CO</MainHeading>
				<HeroText>
					CHARTED ACCONTANTS
				</HeroText>
			</Container>
		</HeroSection>
	);
};

export default Hero;
